import React from 'react';
import './Headerbar.css';


function Headerbar() {
  return (
    <div>
        <div className='headerbar-main'>
            <div>logo</div>
            <div>wording</div>
            <div>searchTab</div>
        </div>
    </div>
  )
}

export default Headerbar;
